import React from "react";
import styled from "styled-components";
import { FaGithub } from "react-icons/fa"; // react-icons에서 GitHub 아이콘 가져오기

const Box = styled.div`
  display: flex; /* Flexbox로 설정 */
  align-items: flex-start;
  width: 1040px;
  height: 100%;
`;

const Image = styled.div`
  height: 250px;
  width: 250px;
  margin-left: 30px;
  border: 1px solid black;
  box-sizing: border-box;
`;

const Info = styled.div`
  height: 790px;
  width: 1040px;
`;

const NameText = styled.div`
  color: #4a4e4d;
  font-family: Roboto;
  font-size: 32px;
  font-style: normal;
  font-weight: 700;
  line-height: normal;
  margin-top: 10px;
  margin-bottom: 10px;
  margin-left: 30px;
  border: 1px solid black;
  box-sizing: border-box;
`;

const Text = styled.div`
  display: flex; /* 아이콘과 텍스트를 가로로 배치 */
  align-items: center; /* 아이콘과 텍스트 세로 정렬 */
  color: #4a4e4d;
  font-family: Roboto;
  font-size: 24px;
  font-style: normal;
  font-weight: 400;
  line-height: 40px;
  margin-left: 30px;
  border: 1px solid black;
  box-sizing: border-box;
`;

const IconWrapper = styled.div`
  margin-right: 10px; /* 아이콘과 텍스트 사이 간격 */
`;

export default function MyInfo() {
  return (
    <Box>
      <Image></Image>

      <Info>
        <NameText>임세연</NameText>
        <Text>ㅇㅇ 대학교</Text>
        <Text>2002.12.02</Text>
        <Text>iteyeonn@gmail.com</Text>
        <Text>
          <IconWrapper>
            <FaGithub size="24" />
          </IconWrapper>
          github 주소
        </Text>
      </Info>
    </Box>
  );
}
